		"full_text": "가장 화가 나는 지점은 거기에 쓴 표현들인데. 그가 말한 \"폭력적\"이라는 표현은 그 자리에서 침묵으로 무대와 배우에 공감하기 위해 노력하던 다른 관객들이 충준히 모욕이라고 느낄 수 있는 단어다. 조용해야 되는 자리에서 조용히 내용을 이해하고 조용히 공감하고 싶었던 건데.",
