		"full_text": "물론 평소에 너무 예민한 관객들이 있다는 말은 인정한다. 하지만 적어도 &lt;프라이드&gt; 같은 극을 두고 그런 소릴 하면 안되지. 예를 들어 퀴어 퍼레이드는 웃고 떠드는 곳이지만 근본적으로 인권 '투쟁'의 공간이다. 싸우는 방식만 다른 거지 싸우는 일이라는 본질은 그대로라는 거다.",
