		"text": "(3/3)\n#퀴어레인보우\n#빌리와엠마: 말이 필요없는 하이틴 로맨스\n#하늘과나무열매: 국내에서 영화로 접하기 힘들었던 인터섹스 당사자의 성장 다큐멘터리\n#야광: 6~90년대 남성 성소수자의 크루징스팟 '파고다극장, 극동극장, 성동극장'을 소재로 '숨기면서 드러내기'를 고민하다 https://t.co/mamXYv3bvH"
