		"text": "카카오뮤직은 기존에 공유 단축주소가 전부 죽고 재배치 시킴. 카카오톡 프로필에 연동시켜 BGM처럼 들을 수 있게 했으나 멜론을 인수하고나서는 멜론으로 집중. 최근 업데이트에서도 프로필 기능을 향상. 새로운 프로필 뮤직 아이템을 설정하면 카카오뮤직은 사라진다고 알리며 목록에 멜론만 표시."
