		"id": 1156941343886758000,
		"id_str": "1157302816790069248",
		"full_text": "예를 들면 상하이 리츠 칼튼 포트만.\n1박에 180불인데 virtuoso rate 으로 예약하면 얼리 체크잇/레이트 체크아웃, 무료 2인 조식, 무료 업그레이드, 호텔 내에서 사용 가능한 100불 크레딧을 얹어준다.\n호텔 레스토랑에서 100불어치 식사 하고 조식까지 공짜니 단순 셈으로는 5,60불에 묵는 샘. https://t.co/vEhWegBk4x",
